import java.util.Scanner;

public class TwoStones {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int N;
		Scanner scan = new Scanner(System.in);
		N =scan.nextInt();
		if (N%2==1){
			System.out.println("Alice");
		}
		else{
			System.out.println("Bob");
		}


	}

}
